IF OBJECT_ID('dbo.proc_transform_453', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_453;
GO
CREATE PROCEDURE dbo.proc_transform_453
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_453
    SET payload = LEFT(payload, 1000) + N'|V4-453|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_453;
END
GO
IF OBJECT_ID('dbo.audit_v4_453', 'U') IS NULL
